import React from 'react';


function CoinList({ coins }) {
    //console.log("55",);
    return (
        <>
            {
                coins.map(coin => (
                    <div>
                        {Object.keys(coin)}
                    </div>
                ))
            }
        </>
    )
};

export default CoinList;
